images={
	"",
	""
}
cur_img=1
t=0


function hex(value)
	result=tostr(value,true)
	result=sub(result,5,6)
	return result
end

function _update()
 t+=5
 if t%10==0 then change_image() end
	image=hex(@0)
 for i=1,8191,1 do
 	image=image..hex(@i)
 end
end

function change_image()
	if cur_img==1 then cur_img=2
	else cur_img=1 end
 load_sprites()
end

function load_sprites()
	for i=1,16384,2 do
		poke((i-1)/2,"0x"..sub(images[cur_img],i,i+1))
	end
end

function _draw()
	cls()
	spr(0,0,0,16,16)
	//print(@0)
	//printh(image,'@clip')
	//print(cur_img)
	//print(t)
end